import React, { Component } from 'react';
import Navbar from '../components/Navbar';

class TripDetail extends Component {
  render() {
    return (
      <div>
        <h1>TripDetail</h1>
        <Navbar />
      </div>
    );
  }
}

export default TripDetail;
